import React from "react";
import cover from "../../images/Image_source_2.png";
import DropdownMenu from "../../components/public/DropdownMenu.js";

const About = () => {
  return (
    <div>
      <div className="about_cover">
        <img src={cover} alt="about_cover_image" />
      </div>
      <div className="dropdown-menu-container">
        <DropdownMenu
          title="Fiabilité"
          content="Les annonces postées sur Kasa garantissent une fiabilité totale. Les photos sont conformes aux logements, et toutes les informations sont régulierement verifiées par nos équipes."
        />
        <DropdownMenu title="Respect" content="Hellow world 2" />
        <DropdownMenu title="Service" content="Hellow world 3" />
        <DropdownMenu title="Sécurité" content="Hellow world 4" />
      </div>
    </div>
  );
};

export default About;
